import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getClos } from "../../actions/clos";
import { Form } from "reactstrap";

export class MapForm extends Component {
  static propTypes = {
    clos: PropTypes.array.isRequired,
    getClos: PropTypes.func.isRequired
  };
  state = {
    clos: []
  };

  //component load then
  componentDidMount() {
    this.props.getClos();
  }
  render() {
    return (
      <Fragment>
        <select>
          {this.state.clos.map(clo => (
            <option key={clo.id} value={clo.code}></option>
          ))}
        </select>
      </Fragment>
    );
  }
}

//state of redux
const mapStateToProps = state => ({
  clos: state.clos.clos
});
export default connect(mapStateToProps, { getClos })(MapForm);
